  render() {
    return (
      <div>
         <Container>
          <Row>
            <Table responsive>
              <thead>
                <tr>
                  <th>Order Number</th>
                  <th>Status</th>
                  <th>Created Time</th>
                  <th>Total Price</th>
                </tr>
              </thead>

              {this.props.orders.map((order) => (
                <tbody> 
                  <tr onClick={this.showOrderDetails(order._id)}>
                  <td>{order._id}</td>
                  <td>
                    {order.status === "open" ? (
                      <Badge variant="success">{order.status}</Badge>
                        ) : (
                      <Badge variant="danger">{order.status}</Badge>
                    )}
                  </td>
                  <td>{order.createdAt}</td>
                  <td>price here</td>
                </tr>
                </tbody>
              ))}

            </Table>
          </Row>
        </Container>
      </div>
    )
  }

}

OrderList.propTypes = {
  orders: PropTypes.array.isRequired
}

export default withRouter(OrderList);
